The best way to handle a breaking change is to begin by issuing future-compatibility warnings. These are a special category of lint warning. Adding a new future-compatibility warning can be done as follows. // 1. Define the lint in `src/librustc/lint/builtin.rs`:
declare_lint! { pub YOUR_ERROR_HERE, Warn, "illegal use of foo bar baz"
} // 2. Add to the list of HardwiredLints in the same file:
impl LintPass for HardwiredLints { fn get_lints(&self) -> LintArray { lint_array!( .., YOUR_ERROR_HERE ) }
} // 3. Register the lint in `src/librustc_lint/lib.rs`:
store.register_future_incompatible(sess, vec![ ..., FutureIncompatibleInfo { id: LintId::of(YOUR_ERROR_HERE), reference: "issue #1234", // your tracking issue here! },
]); // 4. Report the lint:
tcx.lint_node( lint::builtin::YOUR_ERROR_HERE, path_id, binding.span, format!("some helper message here")); Helpful techniques It can often be challenging to filter out new warnings from older, pre-existing errors. One technique that has been used in the past is to run the older code unchanged and collect the errors it would have reported. You can then issue warnings for any errors you would give which do not appear in that original set. Another option is to abort compilation after the original code completes if errors are reported: then you know that your new code will only execute when there were no errors before. Crater and crates.io We should always do a crater run to assess impact. It is polite and considerate to at least notify the authors of affected crates the breaking change. If we can submit PRs to fix the problem, so much the better. Is it ever acceptable to go directly to issuing errors? Changes that are believed to have negligible impact can go directly to issuing an error. One rule of thumb would be to check against crates.io: if fewer than 10 total affected projects are found ( not root errors), we can move straight to an error. In such cases, we should still make the "breaking change" page as before, and we should ensure that the error directs users to this page. In other words, everything should be the same except that users are getting an error, and not a warning. Moreover, we should submit PRs to the affected projects (ideally before the PR implementing the change lands in rustc). If the impact is not believed to be negligible (e.g., more than 10 crates are affected), then warnings are required (unless the compiler team agrees to grant a special exemption in some particular case). If implementing warnings is not feasible, then we should make an aggressive strategy of migrating crates before we land the change so as to lower the number of affected crates. Here are some techniques for approaching this scenario: Issue warnings for subparts of the problem, and reserve the new errors for the smallest set of cases you can. Try to give a very precise error message that suggests how to fix the problem and directs users to the tracking issue. It may also make sense to layer the fix: First, add warnings where possible and let those land before proceeding to issue errors. Work with authors of affected crates to ensure that corrected versions are available before the fix lands, so that downstream users can use them.

