Once we have decided to make a "future warning" into a hard error, we need a PR that removes the custom lint. As an example, here are the steps required to remove the overlapping_inherent_impls compatibility lint. First, convert the name of the lint to uppercase (OVERLAPPING_INHERENT_IMPLS) ripgrep through the source for that string. We will basically by converting each place where this lint name is mentioned (in the compiler, we use the upper-case name, and a macro automatically generates the lower-case string; so searching for overlapping_inherent_impls would not find much). Remove the lint. The first reference you will likely find is the lint definition in librustc/lint/builtin.rs that resembles this : declare_lint! { pub OVERLAPPING_INHERENT_IMPLS, Deny, // this may also say Warning "two overlapping inherent impls define an item with the same name were erroneously allowed"
} This declare_lint! macro creates the relevant data structures. Remove it. You will also find that there is a mention of OVERLAPPING_INHERENT_IMPLS later in the file as part of a lint_array! ; remove it too, Next, you see see a reference to OVERLAPPING_INHERENT_IMPLS in librustc_lint/lib.rs . This defining the lint as a "future compatibility lint": FutureIncompatibleInfo { id: LintId::of(OVERLAPPING_INHERENT_IMPLS), reference: "issue #36889 <https://github.com/rust-lang/rust/issues/36889>",
}, Remove this too. Add the lint to the list of removed lists. In src/librustc_lint/lib.rs there is a list of "renamed and removed lints". You can add this lint to the list: store.register_removed("overlapping_inherent_impls", "converted into hard error, see #36889"); where #36889 is the tracking issue for your lint. Update the places that issue the lint Finally, the last class of references you will see are the places that actually trigger the lint itself (i.e., what causes the warnings to appear). These you do not want to delete. Instead, you want to convert them into errors. In this case, the add_lint call looks like this: self.tcx.sess.add_lint(lint::builtin::OVERLAPPING_INHERENT_IMPLS, node_id, self.tcx.span_of_impl(item1).unwrap(), msg); We want to convert this into an error. In some cases, there may be an existing error for this scenario. In others, we will need to allocate a fresh diagnostic code. Instructions for allocating a fresh diagnostic code can be found here. You may want to mention in the extended description that the compiler behavior changed on this point, and include a reference to the tracking issue for the change. Let's say that we've adopted E0592 as our code. Then we can change the add_lint() call above to something like: struct_span_err!(self.tcx.sess, self.tcx.span_of_impl(item1).unwrap(), msg) .emit(); Update tests Finally, run the test suite. These should be some tests that used to reference the overlapping_inherent_impls lint, those will need to be updated. In general, if the test used to have #[deny(overlapping_inherent_impls)], that can just be removed. ./x.py test All done! Open a PR. =)

